INSERT INTO `Exam` VALUES ('95', '0r2;Or2', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/d812fd0a-b6b8-4bc2-a522-34c7e6c11e27_xmfbp.png', '44', '乡村的线索', 'CSCBT01', '2020-08-13/6dc7c0ae-da95-414d-9d74-e6f24fdac27b_xmf.png', '0', '工厂好远，我足足飞了一天才到那里，在那里我看到了很多很多碎木屑，我猜那就是大树念念的亲人们了。', '1', '');
INSERT INTO `Exam` VALUES ('96', 'P7U', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/cec0a83c-65b8-4ae3-879a-7072808cb16c_xmfbp.png', '122', '工厂中幻化', 'CSCBT01', '2020-08-13/1b67026e-aa4d-4f89-a88c-d839ea738b8c_xmf.png', '0', '为了不辜负大树念念的委托，我决定继续追查下去，去看看那些纸被运去了哪里……', '1', '');
INSERT INTO `Exam` VALUES ('97', '4UR', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/3f1314c5-e9ff-461b-8595-221898d6ee4c_xmfbp.png', '123', '变身成书本', 'CSCBT01', '2020-08-13/d794bc95-8804-43d3-8d32-46fd5a9f31e2_xmf.png', '0', '为了确定是不是你们用的书，我决定飞去学校一探究竟。', '1', '');
INSERT INTO `Exam` VALUES ('98', 'OGJ;0GJ', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/ab176d59-5032-42b1-8673-3bc0c2eab2dd_xmfbp.png', '124', '现身在校园', 'CSCBT03', '2020-08-13/abdf1b7e-c605-4222-bcb7-fc64ad8f38dc_xmf.png', '0', '就在我准备结束调查的时候，放学的铃声响起来了，同学们都收拾书本准备回家了。我决定去同学们的家里看看。', '1', '');
INSERT INTO `Exam` VALUES ('99', 'cNu', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/4627e340-4a97-4ff9-8ef4-11c5c1848f03_xmfbp.png', '125', '家中的陪伴', 'CSCBT02', '2020-08-13/20a26270-a833-448c-bb8a-799eca3b3e2b_xmf.png', '0', '纸对于人类可真是一个有用的好东西，但纸也有没用的时候，我发现垃圾桶里也有好多纸！', '1', '');
INSERT INTO `Exam` VALUES ('100', 'aZ9', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/d62a5ffe-6eef-41a8-90ef-e476ebfba57e_xmfbp.png', '126', '使用的完结', 'CSCBT04', '2020-08-13/829402d0-3297-4929-968e-cd539840c019_xmf.png', '0', '我决定继续追查下去，这些被扔掉的纸最后怎么样了呢？', '1', '');
INSERT INTO `Exam` VALUES ('101', 'O7y;07y', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/29b46fa5-6287-4eb2-967e-5eb2976f7582_xmfbp.png', '127', '命运的终了', 'CSCBT05', '2020-08-13/84d6b102-9c9f-47b7-aa1d-ef9a7a48677c_xmf.png', '0', '带着沮丧的心情，我飞去大树念念所在的小区，看到一辆装满了各种废弃纸张的垃圾车正在往外走……\\n他们也要被运去垃圾填埋场吗？', '1', '');
INSERT INTO `Exam` VALUES ('102', 'Wdj', '10', '找到小蜜蜂标牌，输入标牌上的字符完成探索任务吧！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/fd0eb8d6-1666-4ffc-9e82-c64c5e2b85cc_xmfbp.png', '128', '价值的再生', 'CSCBT06', '2020-08-15/3bdd4a66-42e5-4ea5-8785-0242541f12a5_zhiyuanzhequn.png', '0', '我的心情终于变好了一些，我也终于可以回去把这些消息告诉大树念念了。我发现大树可以变成很多对人类有用的东西，但不断的砍伐也严重破坏了环境，为了我们的家园，我的追查还在继续……希望你能和我一起保护地球家园，积极参与垃圾分类投放！\\n扫描二维码加入“绿色家园建设志愿者群”！\\n完成任务可回到起点领取纪念徽章！', '1', '');
INSERT INTO `Exam` VALUES ('103', 'RzW', '1', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（这张图只是示意，你需要找到真正的标志牌。）	', '注意字母的大小写哦！	', '通关密语	', '2020-08-14/8367cdea-c963-46c6-9fd7-00f080ada483_xmfbp.png', '120', '大树的委托', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '去地图上的2号点寻找蜜蜂侦探吧！（可以点击地图按钮查看位置哦！）	', '1', '');
