INSERT INTO `Exam` VALUES ('118', '其他垃圾', '1111', '回形针属于哪类垃圾？', '回形针看似是金属可回收物，但失去循环利用价值，是不宜列入可回收的垃圾种类。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '回形针看似是金属可回收物，但失去循环利用价值，是不宜列入可回收的垃圾种类。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('119', '其他垃圾', '1111', '缝衣针属于哪类垃圾？', '缝衣针看似是金属可回收物，但失去循环利用价值，缝衣针是不宜列入可回收的垃圾种类。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '缝衣针看似是金属可回收物，但失去循环利用价值，缝衣针是不宜列入可回收的垃圾种类。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('120', '可回收物', '1111', '螺丝刀属于哪类垃圾？', '可回收物是指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。螺丝刀属于可回收物中的废弃金属类。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收物是指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。螺丝刀属于可回收物中的废弃金属类。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('121', '可回收物', '1111', '塑料衣架属于哪类垃圾？', '可回收物是指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。塑料衣架属于常见的一般可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收物是指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。塑料衣架属于常见的一般可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('122', '可回收物', '1111', '损坏的空调遥控器属于哪类垃圾？', '一般可回收物可分为废纸张、废塑料、废玻璃制品、废金属、废织物、复合材料类及其他。空调遥控器属于复合材料类及其他，因此是可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '一般可回收物可分为废纸张、废塑料、废玻璃制品、废金属、废织物、复合材料类及其他。空调遥控器属于复合材料类及其他，因此是可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('123', '其他垃圾', '1111', '隐形眼镜（美瞳）属于哪类垃圾？', '隐形眼镜（美瞳）被列为不宜回收的垃圾，可以将其垃圾扔到其他垃圾桶里丢弃。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '隐形眼镜（美瞳）被列为不宜回收的垃圾，可以将其垃圾扔到其他垃圾桶里丢弃。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('124', '可回收物', '1111', '破损的砧板属于哪类垃圾？', '木类中的小型木制品（积木、砧板）等属于低价值可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '木类中的小型木制品（积木、砧板）等属于低价值可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('125', '其他垃圾', '1111', '剪下来的指甲属于哪类垃圾？', '剪下来的指甲属于除有害垃圾、可回收物、厨余垃圾以外的其他生活废弃物，应该投放至其他垃圾容器内。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '剪下来的指甲属于除有害垃圾、可回收物、厨余垃圾以外的其他生活废弃物，应该投放至其他垃圾容器内。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('126', '其他垃圾', '1111', '橡皮泥属于哪类垃圾？', '橡皮泥、镜子、笔、打火机等均为复合材料类，是不宜回收的垃圾，属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '橡皮泥、镜子、笔、打火机等均为复合材料类，是不宜回收的垃圾，属于其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('127', '厨余垃圾', '1111', '废弃的植物属于哪类垃圾？', '废弃的家养植物会腐烂，是厨余垃圾，可以粉碎做成有机肥料，养护小区内的花草。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '废弃的家养植物会腐烂，是厨余垃圾，可以粉碎做成有机肥料，养护小区内的花草。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('128', '可回收物', '1111', '废弃的玻璃杯属于哪类垃圾？', '正确的做法是投放到小区公共区域设置的可回收物收集容器，如果小区有开展两网融合服务站点，还可以将可回收物交投到这里，由保洁员分拣后纳入废品回收系统。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '正确的做法是投放到小区公共区域设置的可回收物收集容器，如果小区有开展两网融合服务站点，还可以将可回收物交投到这里，由保洁员分拣后纳入废品回收系统。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('129', '可回收物', '1111', '喝过的奶茶杯子属于哪类垃圾？', '喝过的奶茶杯里剩下的液体，属于纯流质的食物垃圾，应先将液体直接倒进下水口，再将塑料饮料瓶冲洗干净后压扁，投放到“可回收物”垃圾桶中。这样既可以减少环卫工人的工作量，又可以压缩塑料瓶的体积，方便运输。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '喝过的奶茶杯里剩下的液体，属于纯流质的食物垃圾，应先将液体直接倒进下水口，再将塑料饮料瓶冲洗干净后压扁，投放到“可回收物”垃圾桶中。这样既可以减少环卫工人的工作量，又可以压缩塑料瓶的体积，方便运输。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('130', '厨余垃圾', '1111', '瓜子壳属于哪类垃圾？', '因为瓜子容易腐烂，易腐蚀，所以属于厨余垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '因为瓜子容易腐烂，易腐蚀，所以属于厨余垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('131', '其他垃圾', '1111', '榴莲壳、椰子壳属于哪类垃圾？', '因为其不易腐烂。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '因为其不易腐烂。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
