INSERT INTO `Exam` VALUES ('151', '其他垃圾', '1111', '薄型塑料袋属于哪类垃圾？', '除了可回收物、有害垃圾、厨余垃圾以外的垃圾都属于其他垃圾，包括餐盒、餐巾纸、湿纸巾、塑料袋、食品包装袋等。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '除了可回收物、有害垃圾、厨余垃圾以外的垃圾都属于其他垃圾，包括餐盒、餐巾纸、湿纸巾、塑料袋、食品包装袋等。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('152', '厨余垃圾', '1111', '吃剩的罐头食品属于哪类垃圾？', '剩菜剩饭、瓜皮果壳等都属于厨余垃圾，吃剩的罐头食品应将罐头去除后分类投放，里面的食物是厨余垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '剩菜剩饭、瓜皮果壳等都属于厨余垃圾，吃剩的罐头食品应将罐头去除后分类投放，里面的食物是厨余垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('153', '其他垃圾', '1111', '用完的笔芯、水笔属于哪类垃圾？', '办公用品，像一些便签、用完的笔芯、水笔等，通常都是其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '办公用品，像一些便签、用完的笔芯、水笔等，通常都是其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('154', '可回收物', '1111', '旧被子属于哪类垃圾？', '旧衣物，书本，书包，旧被子，手机，电脑都可以通过回收再加工，变成其他工业制品，所以它们都属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '旧衣物，书本，书包，旧被子，手机，电脑都可以通过回收再加工，变成其他工业制品，所以它们都属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('155', '可回收物', '1111', '老旧图书属于哪类垃圾？', '制成图书的纸张，能够通过处理进行再生循环。此外，废旧的报纸、杂志、以及广告单及其它干净的纸类等，都属可回收物哦。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '制成图书的纸张，能够通过处理进行再生循环。此外，废旧的报纸、杂志、以及广告单及其它干净的纸类等，都属可回收物哦。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('156', '厨余垃圾', '1111', '受潮过期的瓜子属于哪类垃圾？', '瓜子容易腐烂，属于厨余垃圾，但瓜子的包装物（如塑料包装袋）属于其他垃圾。正确做法是将瓜子投放到厨余垃圾的收集容器，塑料包装袋投放到其他垃圾的收集容器中。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '瓜子容易腐烂，属于厨余垃圾，但瓜子的包装物（如塑料包装袋）属于其他垃圾。正确做法是将瓜子投放到厨余垃圾的收集容器，塑料包装袋投放到其他垃圾的收集容器中。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
