INSERT INTO `Exam` VALUES ('158', '可回收物', '1111', '电视机属于哪类垃圾？', '电子器具的外壳一般由铁制、塑制、钢制或铝制。因此，可从电子废弃物中回收塑料和铁、钢、铝等金属，从而进行二次利用。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '电子器具的外壳一般由铁制、塑制、钢制或铝制。因此，可从电子废弃物中回收塑料和铁、钢、铝等金属，从而进行二次利用。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
