INSERT INTO `Exam` VALUES ('161', '可回收物', '1111', '废旧的吸铁石属于哪类垃圾？', '吸铁石学名磁铁，建议按照金属物质作为可回收物投放。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '吸铁石学名磁铁，建议按照金属物质作为可回收物投放。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('162', '可回收物', '1111', '牛奶盒属于哪类垃圾？', '牛奶等纯流质的食物垃圾应直接倒进下水口。可回收物是指适宜回收利用和资源化利用的废弃物，如玻、金、塑料、纸、衣。立体包装投放时请清空内容物，清洁后压扁投放。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '牛奶等纯流质的食物垃圾应直接倒进下水口。可回收物是指适宜回收利用和资源化利用的废弃物，如玻、金、塑料、纸、衣。立体包装投放时请清空内容物，清洁后压扁投放。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('163', '不进入垃圾分类系统', '1111', '装修垃圾属于哪类垃圾？', '装修垃圾、大件垃圾（如沙发、床垫等）是不可以和生活垃圾混合投放的，同时还应将装修垃圾按照木质类、砖石混凝土类、油漆桶等分类装袋或捆绑堆放。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '装修垃圾、大件垃圾（如沙发、床垫等）是不可以和生活垃圾混合投放的，同时还应将装修垃圾按照木质类、砖石混凝土类、油漆桶等分类装袋或捆绑堆放。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾;不进入垃圾分类系统,不进入垃圾分类系统');
INSERT INTO `Exam` VALUES ('164', '厨余垃圾', '1111', '宠物饲料属于哪类垃圾？', '各类过期食品、食物残渣及宠物饲料都属于厨余垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '各类过期食品、食物残渣及宠物饲料都属于厨余垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('165', '可回收物', '1111', '食用油桶属于哪类垃圾？', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等，食用油桶、饮料瓶、酸奶盒等都属于废塑料，因此属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等，食用油桶、饮料瓶、酸奶盒等都属于废塑料，因此属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('166', '可回收物', '1111', '刀片属于哪类垃圾？', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等，食品罐盒、剪刀、金属办公用品、刀片等都属于金属类，因此属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收物分为纸类、塑料橡胶类、玻璃类、金属类等，食品罐盒、剪刀、金属办公用品、刀片等都属于金属类，因此属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('167', '可回收物', '1111', 'U盘属于哪类垃圾？', 'U盘是电子废弃物，属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', 'U盘是电子废弃物，属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('168', '有害垃圾', '1111', 'X光片属于哪类垃圾？', '胶片显影技术使用的材料，包括相机底片在内的感光胶片都属于有害垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '胶片显影技术使用的材料，包括相机底片在内的感光胶片都属于有害垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('169', '可回收物', '1111', '老旧电视机属于哪类垃圾？', '老旧电视机属于电子废弃物，它在制造时采用了众多材料及资源，其中就包括有色金属、塑料、橡胶、玻璃等可供回收的有用资源。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '老旧电视机属于电子废弃物，它在制造时采用了众多材料及资源，其中就包括有色金属、塑料、橡胶、玻璃等可供回收的有用资源。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('170', '有害垃圾', '1111', '节能灯属于哪类垃圾？', '含汞荧光灯管、节能灯都属于有害垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '含汞荧光灯管、节能灯都属于有害垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('171', '厨余垃圾', '1111', '中药渣属于哪类垃圾？', '茶包、茶叶渣还有冲泡饮料粉末等都属于此类。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '茶包、茶叶渣还有冲泡饮料粉末等都属于此类。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('172', '可回收物', '1111', '旧报纸属于哪类垃圾？', '可回收物是指适宜回收循环使用和资源利用的废物。未严重玷污的文字用纸、包装用纸和其他纸制品等。如报纸、各种包装纸、办公用纸、广告纸片、纸盒等都属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收物是指适宜回收循环使用和资源利用的废物。未严重玷污的文字用纸、包装用纸和其他纸制品等。如报纸、各种包装纸、办公用纸、广告纸片、纸盒等都属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('173', '其他垃圾', '1111', '口红属于哪类垃圾？', '口红不可回收，不是有害垃圾，也不会腐烂，所以归类到其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '口红不可回收，不是有害垃圾，也不会腐烂，所以归类到其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('174', '可回收物', '1111', '二手手机属于哪类垃圾？', '二手手机适宜回收和资源化利用的，属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '二手手机适宜回收和资源化利用的，属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('175', '其他垃圾', '1111', '大骨头属于哪类垃圾？', '大骨头因为难腐蚀，并且质地坚硬、不易粉碎，易损坏厨余垃圾末端处理设备，所以被列入其他垃圾，类似的还有榴莲壳、椰子壳等。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '大骨头因为难腐蚀，并且质地坚硬、不易粉碎，易损坏厨余垃圾末端处理设备，所以被列入其他垃圾，类似的还有榴莲壳、椰子壳等。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('176', '其他垃圾', '1111', '黑色塑料袋属于哪类垃圾？', '黑色塑料袋本身就是废弃塑料加工而成，不具备再次回收利用的价值，属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '黑色塑料袋本身就是废弃塑料加工而成，不具备再次回收利用的价值，属于其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('177', '可回收物', '1111', '洗发水瓶属于哪类垃圾？', '可回收类别中有一种是瓶类里的硬质塑料瓶（如洗衣液瓶、洗发水瓶、内服药瓶）。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '可回收类别中有一种是瓶类里的硬质塑料瓶（如洗衣液瓶、洗发水瓶、内服药瓶）。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('178', '其他垃圾', '1111', '废旧的布面鼠标垫属于哪类垃圾？', '布面鼠标垫因其布面和橡胶难以分离，回收再生技术成本较高或者价值不大，所以可以直接当作其他垃圾投放。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '布面鼠标垫因其布面和橡胶难以分离，回收再生技术成本较高或者价值不大，所以可以直接当作其他垃圾投放。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('179', '厨余垃圾', '1111', '葡萄干属于哪类垃圾？', '在厨余垃圾的小类目中，有一条是“干货”，包括风干、晒干的食品，比如干香菇、桂圆干、红枣等。所以，葡萄干也是厨余垃圾，不是名字里有“干”就是其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '在厨余垃圾的小类目中，有一条是“干货”，包括风干、晒干的食品，比如干香菇、桂圆干、红枣等。所以，葡萄干也是厨余垃圾，不是名字里有“干”就是其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('180', '其他垃圾', '1111', '烟头属于哪类垃圾？', '烟头不可回收，且可以燃烧分解掉，所以不属于有害垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '烟头不可回收，且可以燃烧分解掉，所以不属于有害垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('181', '其他垃圾', '1111', '破碎的碗碟属于哪类垃圾？', '碎碗是由陶瓷组成，已无回收价值，属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '碎碗是由陶瓷组成，已无回收价值，属于其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('182', '可回收物', '1111', '快递的包装属于哪类垃圾？', '快递的包装主要是纸质和塑料两大类，都属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '快递的包装主要是纸质和塑料两大类，都属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('183', '其他垃圾', '1111', '在家洗头产生的碎发、落发属于哪类垃圾？', '头发属于其他垃圾，其他垃圾是指除有害垃圾、可回收物、厨余垃圾以外的其他生活废弃物。对于实在难以辨识类别的生活垃圾，可投入其他垃圾容器内。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '头发属于其他垃圾，其他垃圾是指除有害垃圾、可回收物、厨余垃圾以外的其他生活废弃物。对于实在难以辨识类别的生活垃圾，可投入其他垃圾容器内。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('184', '可回收物', '1111', '碎纸机处理过的碎纸属于哪类垃圾？', '一般而言，碎纸机处理过的碎纸可以回收利用。但是，经过高密级碎纸机处理，被切得特别碎的纸粉，就不能循环利用了。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '一般而言，碎纸机处理过的碎纸可以回收利用。但是，经过高密级碎纸机处理，被切得特别碎的纸粉，就不能循环利用了。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('185', '其他垃圾', '1111', '没用完的铅笔属于哪类垃圾？', '现在的铅笔并不含铅，而是用石墨和黏土制造的，属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '现在的铅笔并不含铅，而是用石墨和黏土制造的，属于其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('186', '其他垃圾', '1111', '包了口香糖的纸巾属于哪类垃圾？', '厨余垃圾就是指容易腐烂可以用于堆肥的瓜皮果皮、剩菜剩饭等废弃物；而其他垃圾就是指除了有害垃圾、可回收物还有厨余垃圾以外的那些废弃物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '厨余垃圾就是指容易腐烂可以用于堆肥的瓜皮果皮、剩菜剩饭等废弃物；而其他垃圾就是指除了有害垃圾、可回收物还有厨余垃圾以外的那些废弃物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('187', '可回收物', '1111', '用来装饰的假花属于哪类垃圾？', '假花材质多为塑料，属于可回收物。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '假花材质多为塑料，属于可回收物。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('188', '其他垃圾', '1111', '装咖啡、奶茶的纸杯属于哪类垃圾？', '纸杯表面压了一层极薄的塑料膜，这层膜在后期处理时很难剥离，所以连带纸杯也失去了再利用的价值，可以连同吸管一并扔至其他垃圾桶内。如果里面有没喝完的“珍珠”等，需先倒至厨余垃圾垃圾桶内。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '纸杯表面压了一层极薄的塑料膜，这层膜在后期处理时很难剥离，所以连带纸杯也失去了再利用的价值，可以连同吸管一并扔至其他垃圾桶内。如果里面有没喝完的“珍珠”等，需先倒至厨余垃圾垃圾桶内。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('189', '厨余垃圾', '1111', '水果的壳和核属于哪类垃圾？', '瓜皮果核等日常生活垃圾产生的容易腐烂的生物质弃废物，属于厨余垃圾。但是需要注意的是，椰子、榴莲等水果拥有坚硬的外壳，不易腐烂分解，应丢弃在其他垃圾垃圾桶中。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '瓜皮果核等日常生活垃圾产生的容易腐烂的生物质弃废物，属于厨余垃圾。但是需要注意的是，椰子、榴莲等水果拥有坚硬的外壳，不易腐烂分解，应丢弃在其他垃圾垃圾桶中。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('190', '有害垃圾', '1111', '过期的药和包装药片的铝箔属于哪类垃圾？', '应该连带包装一并投放。药品因为容易受潮所以也应该连包装进行投放，不要把单独的药片洒落在有害容器中。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '应该连带包装一并投放。药品因为容易受潮所以也应该连包装进行投放，不要把单独的药片洒落在有害容器中。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('191', '不进入垃圾分类系统', '1111', '小狗产生的便便属于哪类垃圾？', '应该进入到城市粪便处理系统。目前，针对北京养宠人士增长的情况，不少小区都在绿化带安装了宠物粪便处理装置。也可以将粪便带回家中，通过抽水马桶处理。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '应该进入到城市粪便处理系统。目前，针对北京养宠人士增长的情况，不少小区都在绿化带安装了宠物粪便处理装置。也可以将粪便带回家中，通过抽水马桶处理。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾;不进入垃圾分类系统,不进入垃圾分类系统');
INSERT INTO `Exam` VALUES ('192', '其他垃圾', '1111', '擤过感冒鼻涕的餐巾纸属于哪类垃圾？', '尿过尿的尿不湿、使用过的卫生巾、卫生护垫都属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '尿过尿的尿不湿、使用过的卫生巾、卫生护垫都属于其他垃圾。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('193', '其他垃圾', '1111', '湿巾纸属于哪类垃圾？', '厨余垃圾通俗来理解就是容易腐烂的垃圾，显然，湿巾纸不容易腐烂，属于其他垃圾。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '厨余垃圾通俗来理解就是容易腐烂的垃圾，显然，湿巾纸不容易腐烂。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
INSERT INTO `Exam` VALUES ('194', '厨余垃圾', '1111', '鸡骨头属于哪类垃圾？', '因为鸡骨、鱼骨、玉米棒、苹果核等较软、 易腐蚀，所以属于“厨余垃圾”。', '每日打卡，建设绿色家园', '', '1', '每日打卡题库专用-请勿删除', '', '', '0', '因为鸡骨、鱼骨、玉米棒、苹果核等较软、 易腐蚀，所以属于“厨余垃圾”。', '3', '厨余垃圾,厨余垃圾;可回收物,可回收物;有害垃圾,有害垃圾;其他垃圾,其他垃圾');
