INSERT INTO `Exam` VALUES ('196', 'N53', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（下面这个只是示意图，你需要找到真正的标志牌。）	', '注意字母的大小写哦！	', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '157', '大树的委托', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '去地图上的2号点寻找蜜蜂侦探吧！\\n\\n（可以点击地图按钮查看位置哦！）	', '1', '');
INSERT INTO `Exam` VALUES ('197', 'Z4x', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '158', '消失的树林', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '念念家乡附近有个小村庄，我决定先去那里看看有没有什么线索。', '1', '');
INSERT INTO `Exam` VALUES ('198', 'aZ9', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '159', '乡村的线索', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '工厂好远，我足足飞了一天才到那里，在那里我看到了很多很多碎木屑，我猜那就是大树念念的亲人们了。\\n\\n我决定进去看看。', '1', '');
INSERT INTO `Exam` VALUES ('199', '4UR', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '160', '工厂中幻化', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '为了不辜负大树念念的委托，我决定继续追查下去，去看看那些纸被运去了哪里……', '1', '');
INSERT INTO `Exam` VALUES ('200', 'Z4x', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '161', '变身成书本', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '为了确定是不是你们用的书，我决定飞去学校一探究竟。', '1', '');
INSERT INTO `Exam` VALUES ('201', 'nR9', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '162', '现身在校园', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '就在我准备结束调查的时候，放学的铃声响起来了，同学们都收拾书本准备回家了。我决定去同学们的家里看看。', '1', '');
INSERT INTO `Exam` VALUES ('202', 'Juv', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '163', '家中的陪伴', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '纸对于人类可真是一个有用的好东西，但纸也有没用的时候，我发现垃圾桶里也有好多纸！', '1', '');
INSERT INTO `Exam` VALUES ('203', 'b4y', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '164', '使用的完结', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '我决定继续追查下去，这些被扔掉的纸最后怎么样了呢？', '1', '');
INSERT INTO `Exam` VALUES ('204', '5Vp', '10', '找到小蜜蜂标牌，输入标牌上的字符就可以获得下一个线索啦！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '165', '命运的终了', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '带着沮丧的心情，我飞去大树念念所在的小区，看到一辆装满了各种废弃纸张的垃圾车正在往外走……\\n他们也要被运去垃圾填埋场吗？', '1', '');
INSERT INTO `Exam` VALUES ('205', 'YGL', '10', '找到小蜜蜂标牌，输入标牌上的字符完成探索任务吧！\\n（注意字母的大小写哦）', '你可能找到了一个错误的标牌，再找找看吧！', '通关密语	', '2020-08-14/f5221b95-f5f2-448b-95e5-2cde5119a4be_xmfbp.png', '166', '价值的再生', 'CSCBT01', '2020-08-14/e0a57688-19ae-4f16-a5d7-40148c90f264_xmf.png', '0', '我的心情终于变好了一些，我也终于可以回去把这些消息告诉大树念念了。我发现大树可以变成很多对人类有用的东西，但不断的砍伐也严重破坏了环境，为了我们的家园，我的追查还在继续……希望你能和我一起保护地球家园，积极参与垃圾分类投放！\\n', '1', '');
