INSERT INTO `Tip` VALUES ('166', '', '1', '1', '点击解锁可以查看树叶的样子！', '122', '工厂中幻化', '3', '2020-08-14/8fe93a7b-5a5b-43c6-b639-e7d444c9f708_cp04-yz.jpg');
INSERT INTO `Tip` VALUES ('167', '上面的树皮和树叶来自一丛低矮的灌木，而不是一个高大的乔木，就在楼房的西边，去那里找找看吧！', '1', '1', '如果你还没找到，下面是详细的位置描述！', '122', '工厂中幻化', '4', '');
INSERT INTO `Tip` VALUES ('168', '', '1', '1', '这个地方，我决定先给你看看叶子长什么样。', '123', '变身成书本', '2', '2020-08-14/1c65dc5b-06a6-4f4e-84ba-9d1498ea0397_cp05-yz.jpg');
