INSERT INTO `Tip` VALUES ('198', '大家好，我是一棵元宝枫，我的名字叫“念念”，我已经在这里生活了10年了。 被移栽到这里之前，我生活在一个大山里。 我很想念家乡的亲人们，于是我委托蜜蜂侦探“聪聪”去我的家乡看看，却一直没有消息，我很着急，你能帮我找到聪聪问问情况吗？', '0', '0', '', '157', '01 大树的委托', '1', '2020-08-15/c5df3c84-6ca4-4319-ac7a-6f4c92e9fa06_gs01.jpg');
INSERT INTO `Tip` VALUES ('199', '蜜蜂侦探聪聪说，找到“小蜜蜂标志牌”就可以凭借上面的“通关密语”来跟它对话了。\\n\\n下面这张图就是小蜜蜂标志牌的样子，第一个标志牌就挂在我的树枝上。', '0', '0', '', '157', '01 大树的委托', '2', '2020-08-15/4cfb91d4-ab49-4493-9a69-5358706cb2bd_xmfbp2.png');
INSERT INTO `Tip` VALUES ('201', '你好，我是蜜蜂侦探聪聪，我发现大树念念家乡的树木都被砍伐了，我不想把这个令人悲伤的消息告诉念念，我需要赶快去追查他们都去了哪里。\r\n我把追查到的信息都留在“小蜜蜂标志牌”那里了，快去找到它吧。\r\n', '0', '0', '', '158', '消失的树林', '1', '2020-08-12/527376f4-4e85-4751-83a2-27763ab180de_gs02.jpg');
INSERT INTO `Tip` VALUES ('205', '我在这个村庄里发现了一些木柴，开始我以为那就是念念的亲人们。后来听村里的老爷爷说，那片树林是在一年前被砍伐的，木材都被运去附近的工厂里了，我需要去那个工厂看看。', '0', '0', '', '159', '乡村的线索', '1', '2020-08-12/19031aef-c6b4-4555-b4f1-2e2b99f8a9be_gs03.jpg');
INSERT INTO `Tip` VALUES ('209', '在这个工厂里已经看不到完整的树木，通过气味和木屑的纹路，我判断大树念念的亲人也在这里。这里的工人们把碎木屑运进一个大厂房里，经过很多道工序之后，最后变成了纸，原来这里是个造纸厂。', '0', '0', '', '160', '工厂中幻化', '1', '2020-08-12/ae23e07a-403b-423b-8148-97acf0e76549_gs04.jpg');
INSERT INTO `Tip` VALUES ('213', '我跟着运送纸的车子飞了好久，就在我快坚持不下去的时候，终于，终于，终于到了。我发现那些纸被运到了一个新的工厂里，纸在这里被印上了图案和文字，工人们又把这些有图案和文字的纸装订成一册一册的，好像就是你们用的书吧。', '0', '0', '', '161', '变身成书本', '1', '2020-08-12/5a64bbc0-1b5e-46bf-b8b7-b29e81baa232_gs05.jpg');
INSERT INTO `Tip` VALUES ('217', '我飞到学校的教室里，看到同学们正在上课，课桌上摆放的正是我在印刷厂看到的那些书。那些被砍伐的树木，变成了帮助你们学习的书本，大树念念如果知道这些，应该也会感到欣慰吧。', '0', '0', '', '162', '现身在校园', '1', '2020-08-12/a623d23c-4336-430d-85e8-091bc9991375_gs06.jpg');
INSERT INTO `Tip` VALUES ('220', '我飞到了一户人的家里，看到好多好多的纸，有课本，有漫画书，有各种各样的书，还有纸箱子、纸盒子、餐巾纸、纸杯子……原来人类的生活中有好多地方都会用到纸啊。', '0', '0', '', '163', '家中的陪伴', '1', '2020-08-12/66077cfa-a44b-406d-93fe-d4d89f45962b_gs07.jpg');
INSERT INTO `Tip` VALUES ('224', '我飞到垃圾桶边上看了看，里面有餐巾纸、旧报纸还有被抛弃了的书本，还混杂着水果皮、菜叶子，散发出一股难闻的气味。\r\n我该怎么去跟念念说呢？这些纸，这些树木做成的纸被抛弃了吗？被扔掉的纸又会去到哪里呢？ \r\n', '0', '0', '', '164', '使用的完结', '1', '2020-08-12/db6bf5fd-0b65-441e-a512-d8810d017c1d_gs08.jpg');
INSERT INTO `Tip` VALUES ('228', '我一路追查，发现那些被扔掉的纸，混着这果皮、菜叶子的纸，经过几次转运最后被送到了“垃圾填埋场”，它们作为纸的一生，就这样结束在了垃圾填埋场里。\r\n\\n我该如何跟大树念念讲述发生的这些事呢？\r\n', '0', '0', '', '165', '命运的终了', '1', '2020-08-12/5986a794-7ed9-47fc-b690-85afc882c7e7_gs09.jpg');
INSERT INTO `Tip` VALUES ('232', '我跟着那辆垃圾车，飞啊飞，发现这些纸被运去了另外一个地方——回收处理厂。在回收处理厂，我了解到，原来被分类丢弃的废旧纸张，没有被厨余垃圾所污染，是比较容易回收并制作成新的纸张的，原来纸也还可以有新的生命。\r\n我的心情终于变好了一些，我也终于可以回去把这些消息告诉大树念念了。', '0', '0', '', '166', '价值的再生', '1', '2020-08-12/23e38376-6c5d-4df3-ba59-2d766c305f01_gs10.jpg');
INSERT INTO `Tip` VALUES ('237', '念念生长在“中关村众享荟”旁，这座大楼里展出了很多关于这个地方的历史。\\n\r\n', '1', '1', '【点击下面的小锁头，可以获得更多线索哦！】', '157', '01 大树的委托', '3', '2020-10-31/5dbf10b1-e40a-4dc3-8e3a-e7c501949d3c_zgc01.jpg');
